import React from 'react';
import { TaskDetails } from '../entities/TaskManagmentEntities';
interface IProps {
}

interface IState {
    error: string | null,
    isLoaded: boolean,
    tasks: TaskDetails[]
}
class TaskList extends React.Component<IProps, IState> {
    constructor(props: {} | Readonly<{}>) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            tasks: []
        };
    }

    componentDidMount() {
        fetch("api/TaskManagementApi/GrtTasks")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        items: result.items
                    });
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
            )
    }

    render() {
        return (
            <div className="card">
                <div className="card-body">
                    task list
                </div>
            </div>
        );
    }
}
export default TaskList
